import React, { useState, useEffect} from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import TestListView from './views/TestListView';
import TestsForPatient from './data/TestsForPatient';

function TestList() {
  const [loading, setLoading] = useState(true);
  const [testList, setTestList] = useState([]);

  useEffect(() => {
    fetchTestList();
  }, []);

  const fetchTestList = async () => {
    try {
      const fetchedTestList = await TestsForPatient();
      setTestList(fetchedTestList);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching test list:', error);
    }
  };

  return (
    <>
      {loading ? (
        <p>Loading test list...</p>
      ) : (
        <TestListView test_list={testList} />
      )}
    </>
  );
}

export default TestList;
